import { createBrowserRouter } from "react-router-dom";
import Admin from "../Components/Admin/Admin";
import EditRoomDetails from "../Components/Admin/EditRoomDetails/EditRoomDetails";
import Book from "../Components/Book/Book";
import Payment from "../Components/Book/Payment";
import AddNewRoom from "../Components/Dashboard/AddNewRoom";
import AllRooms from "../Components/Dashboard/AllRooms";
import Allusers from "../Components/Dashboard/Allusers";
import Bookings from "../Components/Dashboard/Bookings";
import User from "../Components/Dashboard/User";
import Home from "../Components/Home/Home";
import LoginPage from "../Components/LoginPage/LoginPage";
import Others from "../Components/Other/Others";
import RegisterPage from "../Components/RegisterPage/RegisterPage";
import VerifyAdmin from "../Components/VerifyAdmin/VerifyAdmin";
import DashboardLayout from "../Layout/DashboardLayout";
import Main from "../Layout/Main";
import AdminRoute from "./AdminRoute";
import PrivateRoute from "./PrivateRoute";
import Service from "../Components/Rooms/Service";
import ServiceDetails from "../Components/Rooms/ServiceDetails";

export const router = createBrowserRouter([
  {
    path: "/",
    element: <Main></Main>,
    children: [
      {
        path: "/",
        element: <Home></Home>,
      },
      {
        path: "/home",
        element: <Home></Home>,
      },
      {
        path: "/service/:id",
        loader: ({ params }) =>
          fetch(`/service.json`) // Fetch the entire JSON file
            .then((response) => response.json())
            .then((data) => data[params.id]), // Access the specific item by ID
        element: <ServiceDetails></ServiceDetails>,
      },

      {
        path: "/service",
        element: <Service></Service>,
      },
      {
        path: "/book",
        element: (
          <PrivateRoute>
            <Book></Book>
          </PrivateRoute>
        ),
      },
      {
        path: "/login",
        element: <LoginPage></LoginPage>,
      },
      {
        path: "/register",
        element: <RegisterPage></RegisterPage>,
      },

      {
        path: "/about",
        element: <Others></Others>,
      },
      {
        path: "/verifyAdmin",
        element: <VerifyAdmin></VerifyAdmin>,
      },
      {
        path: "/admin",

        element: <Admin></Admin>,
      },
      {
        path: "/payment/:id",
        loader: ({ params }) =>
          fetch(`http://localhost:5000/service/${params.id}`),
        element: (
          <PrivateRoute>
            <Payment></Payment>
          </PrivateRoute>
        ),
      },
      {
        path: "/roomdetails/:id",
        loader: ({ params }) =>
          fetch(`http://localhost:5000/room/${params.id}`),
        element: <EditRoomDetails></EditRoomDetails>,
      },
    ],
  },
  {
    path: "/dashboard",
    element: <DashboardLayout></DashboardLayout>,
    children: [
      {
        path: "/dashboard/userDetail",
        element: (
          <PrivateRoute>
            <User></User>
          </PrivateRoute>
        ),
      },
      {
        path: "/dashboard/booking",
        element: (
          <PrivateRoute>
            <Bookings></Bookings>{" "}
          </PrivateRoute>
        ),
      },
      {
        path: "/dashboard/allusers",
        element: (
          <AdminRoute>
            <PrivateRoute>
              <Allusers></Allusers>
            </PrivateRoute>
          </AdminRoute>
        ),
      },
      {
        path: "/dashboard/allrooms",
        element: (
          <AdminRoute>
            <PrivateRoute>
              <AllRooms></AllRooms>
            </PrivateRoute>
          </AdminRoute>
        ),
      },
      {
        path: "/dashboard/addroom",
        element: (
          <AdminRoute>
            <PrivateRoute>
              <AddNewRoom></AddNewRoom>
            </PrivateRoute>
          </AdminRoute>
        ),
      },
    ],
  },
]);
